    if (array.length <= 1) {
        return array;
    }
    // divide step of mergeSort
    var middle = Math.floor(array.length / 2);
    var left = array.slice(0, middle);
    var right = array.slice(middle);
    return merge(mergeSort(left, comparatorFn), mergeSort(right, comparatorFn), comparatorFn);
